import React from 'react';

function HeroBanner() {
    return (
        <div className="hero-banner">
            <h1>Model Y Starting at $36,490 After Federal Tax Credit</h1>
            <h2>
                <p>Eligible buyers qualify for a $7,500 federal tax credit. Applied at time of Model Y delivery. <a href="#">See Details</a></p>
                <p>Prices will increase by $1,000 for all Model Y trims on April 1.</p>
            </h2>
            <div>
                <a href="#">Shop Available</a>
                <a href="#">Demo Drive</a>
            </div>
        </div>
    )
}

export default HeroBanner;
